DROP TABLE IF EXISTS `staffs`;
CREATE TABLE `staffs` (
  `id` varchar(36) NOT NULL,
  `names` varchar(300) NOT NULL,
  `email` varchar(300) DEFAULT NULL,
  `userId` varchar(36) DEFAULT NULL,
  `barCode` varchar(100) DEFAULT NULL,
