  `role` varchar(100) DEFAULT NULL,
  `role_ab` varchar(10) DEFAULT NULL,
  `storeId` varchar(36) DEFAULT NULL,
  `deleted` tinyint(1) NOT NULL DEFAULT '0',
  `creatorId` varchar(36) DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `active` tinyint(1) DEFAULT NULL,
  `staffCode` varchar(24) DEFAULT NULL,
  `organizationId` varchar(36) DEFAULT NULL,
  `type` tinyint(4) NOT NULL,
  `emailStatus` tinyint(1) NOT NULL,
  `preRank` int(2) NOT NULL DEFAULT '0',
  `curRank` int(2) NOT NULL DEFAULT '0',
  `portrait` varchar(256) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

